import React from 'react';
import './banker.css';

function Banker({ receivedMessage }) {
  return (
    <div className="banker">
      <p className="announcement turn">
        <span>플레이어 1</span>
        <span>님의 차례입니다.</span>
      </p>
      <p className="announcement anc-message">
        {receivedMessage ? receivedMessage : "서버에서 받은 메세지가 없습니다."}
      </p>
    </div>
  );
}

export default Banker;
